import React from 'react';
import { Box, Typography, TextField, Button } from '@mui/material';

const StartupProfile: React.FC = () => {
  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Startup Profile
      </Typography>
      <Box component="form" sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
        <TextField label="Startup Name" variant="outlined" fullWidth />
        <TextField label="Industry" variant="outlined" fullWidth />
        <TextField label="Description" variant="outlined" fullWidth multiline rows={4} />
        <Button variant="contained" color="primary">
          Save Profile
        </Button>
      </Box>
    </Box>
  );
};

export default StartupProfile;
